import React from "react";

import { NavLink } from "react-router-dom";

const Navigation = () => {
  return (
    <div>
      <div id='globalnav'>
        <div id='gnavLogo'>Kartensammlung </div>
        <NavLink to='/Kontakt'>Kontakt</NavLink>
        <NavLink to='/Kartenviewer'>Kartenviewer</NavLink>
        <NavLink to='/Kartenkatalog'>Kartenkatalog</NavLink>
        <NavLink to='/'>Startseite</NavLink>
      </div>
    </div>
  );
};

export default Navigation;
